window.bookSummaryJSON = "<p>Sometimes I wonder what my hockey career is worth.<br> Blood, sweat, and tears, sure.<br> But losing Ash?<br> I <i>can't.</i><br> <br> I shouldn't ask this of her.<br> To ignore the rumors.<br> To let go of the scandal.<br> To accept the spotlight.<br> To give up her dreams so I can chase mine.<br> <br> Balancing it all, though?<br> Well, that's a different sort of torture.<br> I have no idea how long I can hold on without my past catching up to us.<br> And when it does?<br> Well, Ash deserves better than a screw up like me.</p>"; 
